import "./ExpenseFilter.css";
import React, { useState } from "react";

const ExpenseFilter=(props)=>{

 
  return <div className="filter-cotainer">
    <select>
      {props.options.map((el)=>{
        <option>{el}</option>
      })
      }
    </select>
  </div>
}
export default ExpenseFilter;
